const val USERNAME_ARG_KEY = "userName"
const val pictureNavigationRoute = "picture/{$USERNAME_ARG_KEY}"

fun NavController.navigateToPicture(userName: String) {
    this.navigate(pictureNavigationRoute.replace("{$USERNAME_ARG_KEY}", userName))
}

fun NavGraphBuilder.pictureScreen(onNavigateUp: () -> Unit) {
    composable(
        route = pictureNavigationRoute,
        arguments = listOf(
            navArgument(USERNAME_ARG_KEY) { type = NavType.StringType }
        )
    ) {
        PictureRoute(onNavigateUp = onNavigateUp)
    }
}

@Composable
fun PictureRoute(
    onNavigateUp: () -> Unit,
    viewModel: PictureViewModel = hiltViewModel()
) {
    val userName by viewModel.userName.collectAsStateWithLifecycle()
    val pictureUiState by viewModel.uiState.collectAsStateWithLifecycle()
    PictureScreen(
        userName = userName,
        pictureUiState = pictureUiState,
        onNavigateUp = onNavigateUp
    )
}

@Composable
private fun PictureScreen(
    userName: String,
    pictureUiState: PictureUiState,
    onNavigateUp: () -> Unit
) {
    Scaffold(
        topBar = {
            TopAppBar(
                title = { Text(text = userName, style = OrbitTheme.typography.title1) },
                onNavigateUp = onNavigateUp
            )
        }
    ) { paddingValues ->
        when (pictureUiState) {
            PictureUiState.Loading -> PictureLoading()
            PictureUiState.Error -> PictureLoadingFailed()
            is PictureUiState.Success -> PictureLoaded(paddingValues, pictureUiState.encodedPicture)
        }
    }
}

@Composable
private fun PictureLoading() {
    Box(
        modifier = Modifier.fillMaxSize()
    ) {
        CircularProgressIndicator(modifier = Modifier.align(Alignment.Center))
    }
}

@Composable
private fun PictureLoadingFailed() {
    Box(
        modifier = Modifier.fillMaxSize()
    ) {
        Column(
            modifier = Modifier.align(Alignment.Center)
        ) {
            Image(
                modifier = Modifier,
                painter = Illustrations.Error,
                contentDescription = null
            )
            Text(
                modifier = Modifier
                    .padding(16.dp)
                    .align(Alignment.CenterHorizontally),
                text = stringResource(id = R.string.error_ups_error)
            )
        }
    }
}

@Composable
private fun PictureLoaded(paddingValues: PaddingValues, picture: Base64Picture) {
    Column(
        modifier = Modifier
            .padding(paddingValues)
            .fillMaxSize()
            .verticalScroll(rememberScrollState())
            .padding(16.dp)
    ) {
        PictureWithLabel(picture)
        PictureDescription()
    }
}

@OptIn(ExperimentalEncodingApi::class)
@Composable
private fun PictureWithLabel(picture: Base64Picture) {
    val isLoading = remember { mutableStateOf(false) }
    val image: MutableState<ImageBitmap?> = remember { mutableStateOf(null) }
    LaunchedEffect(key1 = picture) {
        isLoading.value = false
        val decoded: ByteArray = Base64.decode(picture.data)
        val bitmap: Bitmap? = BitmapFactory.decodeByteArray(decoded, 0, decoded.size)
        bitmap?.let {
            image.value = it.asImageBitmap()
        }
        isLoading.value = true
    }
    Column {
        Text(
            modifier = Modifier,
            text = stringResource(id = R.string.picture),
            style = OrbitTheme.typography.title2
        )

        if (isLoading.value) {
            image.value?.let { picture ->
                FramePicture(
                    modifier = Modifier.align(Alignment.CenterHorizontally),
                    picture = picture
                )
            }
        } else {
            Column(
                modifier = Modifier.fillMaxWidth()
            ) {
                CircularProgressIndicator(modifier = Modifier.align(Alignment.CenterHorizontally))
            }
        }
    }
}

@Composable
private fun FramePicture(modifier: Modifier = Modifier, picture: ImageBitmap) {
    Image(
        modifier = modifier
            .padding(16.dp)
            .background(color = Color.Black)
            .padding(4.dp),
        bitmap = picture,
        contentDescription = null
    )
}

@Composable
private fun PictureDescription() {
    Column {
        Text(
            modifier = Modifier.padding(top = 8.dp, bottom = 8.dp),
            text = stringResource(id = R.string.description),
            style = OrbitTheme.typography.title2
        )
        PictureDescriptionPoints()
    }
}

/**
 * A general Chat GPT input text about an human eye. Purely for better UI look.
 */
@Composable
private fun PictureDescriptionPoints() {
    Column {
        DescriptionParagraph(text = stringResource(id = R.string.picture_description_1))
        DescriptionParagraph(text = stringResource(id = R.string.picture_description_2))
        DescriptionParagraph(text = stringResource(id = R.string.picture_description_3))
        DescriptionParagraph(text = stringResource(id = R.string.picture_description_4))
        DescriptionParagraph(text = stringResource(id = R.string.picture_description_5))
    }
}

@Composable
private fun DescriptionParagraph(text: String) {
    Text(
        modifier = Modifier.padding(top = 4.dp, bottom = 4.dp),
        text = text,
        style = OrbitTheme.typography.bodyNormal
    )
}

